import * as Animatable from 'react-native-animatable';

Animatable.initializeRegistryWithDefinitions({
  waveform: {
    0: {
      opacity: 0,
      scale: 0.8,
      translateX: Dimensions.CARD_IMAGE_SIZE_SMALL,
    },
    0.2: { opacity: 1, scale: 0.8 },
    0.8: { opacity: 1, scale: 0.8 },
    1: {
      opacity: 0,
      scale: 0.8,
      translateX: -Dimensions.CARD_IMAGE_SIZE_SMALL,
    },
  },

  fingerUpAndOut: {
    0: {
      translateY: 100,
    },
    0.3: {
      translateY: 30,
    },
    0.7: {
      translateY: 30,
    },
    1: {
      translateY: 100,
    },
  },

  fingerUp: {
    0: {
      translateY: 100,
    },
    1: {
      translateY: 30,
    },
  },

  fingerDown: {
    0: {
      translateY: 30,
    },
    1: {
      translateY: 100,
    },
  },
});
